import React from "react";
import "./App.css";
import { BacklogProvider } from "./BacklogContext";
import BacklogDisplay from "./BacklogDisplay";
import AddBacklog from "./AddBacklog";

function App() {
  return (
    <BacklogProvider>
      <div className="App">
        <BacklogDisplay />
        <AddBacklog />
      </div>
    </BacklogProvider>
  );
}

export default App;
